    console.log(prop)
    //console.log(prop.title)
  return (
    <header>
        <h1>{prop.title}</h1>
    </header>
    )
}

//if <Header /> is passed with smth, this is overwritten
Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string,
}

export default Header
